import React from 'react';

const Dialogs = () => {
    return (
        <div className={'dialogs'}>
           <div className={'dialog-items'}>
               <div className={'item'}>
                   Alex
               </div>
               <div className={'item'}>
                   Igor
               </div>
               <div className={'item'}>
                   Leha
               </div>
               <div className={'item'}>
                   Gleb
               </div>
           </div>
        </div>
    );
};

export default Dialogs;
